import React,{useState} from 'react'
import './NoteContainer.css'
import NoteContainerStart from './NoteContainerStart'
import NoteContainerAdded from './NoteContainerAdded'

function NoteContainer({title,content}) {

  // const [showNote,setShowNote] = useState(false)
  return (
    <>
    {
      true ? <NoteContainerStart/> : <NoteContainerAdded title={title} content={content}/>
    }
    </>
  )
}

export default NoteContainer
